import Keyboard from "./keyboard/Keyboard";
import TextToType from "./topPart/TextToType";
import TopPart from "./topPart/TopPart";
import "./styles.css";
// {/* <link
//   rel="stylesheet"
//   href="https://fonts.googleapis.com/icon?family=Material+Icons"
// /> */}
// import KeyboardIcon from '@mui/icons-material/Keyboard';
function App() {
  return (
    <div className="App">
      <div className="headerContainer">
        <div className="HeadingAd"></div>
      </div>
      <div className="container">
        <div className="leftDiv">
          <div className="SecondAd"></div>
        </div>
        <div className="middleDiv">
          <div className="MainPart">
            <TopPart/>
            <TextToType/>
            <Keyboard />
          </div>
        </div> 
      </div>
      <div className="rightDiv">
        <div className="SidePart">
          <div className="UserAccount">gmail</div>
          <div className="actions"></div>
          <div className="Practice">Practice</div>
          <div className="Profile">Profile</div>
          <div className="TypingTest">TypingTest</div>
          <div className="Help">Help</div>
          <div className="HighScores"></div>High Scores</div>
          <div className="Multiplayler">Multiplayer</div>
          <div className="layouts">Layouts</div>
          <div className="TextTools">Text Tools</div>
        </div>
      </div>
    // </div>
  )
}

export default App;
